style.css:
/* i really want this to be global */
.ytp-play-progress {
    animation:7s background linear infinite alternate!important;
    -webkit-animation:7s background linear infinite alternate!important;
    -moz-animation:7s background linear infinite alternate!important;
    -ms-animation:7s background linear infinite alternate!important;
}
@keyframes background{
    0%{
        background:#2083cf;
        -webkit-background:#2083cf;
        -moz-background:#2083cf;
        -ms-background:#2083cf;
    }
    50%{
        background:#2793E6;
        -webkit-background:#2793E6;
        -moz-background:#2793E6;
        -ms-background:#2793E6;
        
    }
    100%{
        background:#2f9bee;
        -webkit-background:#2f9bee;
        -moz-background:#2f9bee;
        -ms-background:#2f9bee;
    }
}
.ytp-progress-bar-container {
    height: 10px !important;
}
.ytp-progress-list,.video-ads .ytp-progress-list.ytp-ad-progress-list {
    height: 13px !important;
}
.ytp-scrubber-button {
background:url('data:image/gif;base64,') !important;
    width: 40px !important;
    height: 20px !important;
    margin-left: -23px !important;
    margin-top: -6px !important;
    transform: scale(0.8);
    -webkit-transform: scale(0.8);
    -moz-transform: scale(0.8);
    -ms-transform: scale(0.8);
}

.ytp-menuitem .ytp-menuitem-toggle-checkbox {
   background: #2793E6 !important;
}


.ytp-chrome-controls .ytp-button.ytp-youtube-button:hover:not .ytp-svg-fill-logo-tube-lozenge {
   fill: #2793E6 !important;
}
.ytp-cued-thumbnail-overlay:hover .ytp-large-play-button-bg, .ytp-large-play-button.ytp-touch-device .ytp-large-play-button-bg {
   fill: #2793E6 !important;
}

.ytp-settings-button.ytp-hd-quality-badge::after, .ytp-settings-button.ytp-4k-quality-badge::after, .ytp-settings-button.ytp-5k-quality-badge::after, .ytp-settings-button.ytp-8k-quality-badge::after, .ytp-settings-button.ytp-3d-badge::after {
   background-color: #2793E6 !important;
}
.ytp-swatch-color {
   color: #2793E6 !important;
}
